  const loadUsers = async () => {
    try {
      const response = await axios.get('http://localhost:8080/api/posts'); // ‚úÖ Corrected to use your backend, not JDBC
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
    }
  };

  return (
    <div className="container py-5 text-center">
      <h1 className="fw-bold text-primary">üåç Welcome to Asiru</h1>
